# Rime dictionary
# encoding: utf-8
# Unicode13.0码表
# Unicode范围0000-10FFFF
# 目前的Unicode字符分为17组编排，每组称为平面（Plane），而每平面拥有65536（即2¹⁶）个代码点。然而目前只用了少数平面。
## 0号平面 U+0000 - U+FFFF 基本多文种平面（BMP）
###其中 U+E000–U+F8FF 为私人使用区（PUA，Private Use Area），6400个码位。
## 1号平面 U+10000 - U+1FFFF 多文种补充平面（SMP）用于摆放拼音文字（主要为现时已不再使用的古老文字）、手写文字、音符、绘文字和其他图形符号。用于学者的专业论文中使用的古老或过时的语言书写符号，以及网络通信等使用的表情符号。范围在U+10000～U+1FFFD。
## 2号平面 U+20000 - U+2FFFF 表意文字补充平面（SIP）整个平面配置的都是一些罕用的汉字或地区的方言用字，如粤语用字及越南语的字喃。现时摆放了“中日韩统一表意文字扩展B区”（4万3253个汉字）、“中日韩统一表意文字扩展C区”（4149个汉字）、“中日韩统一表意文字扩展D区”（222个汉字）、“中日韩统一表意文字扩展E区”（5762个汉字）、“中日韩统一表意文字扩展F区”（7473个汉字）以及中日韩兼容表意文字增补（CJK Compatibility Ideographs Supplement）。
## 3号平面	U+30000 - U+3FFFF 表意文字第三平面（TIP）本平面现已用来摆放汉字扩展区G，并规划用于摆放甲骨文、金文、小篆、中国战国时期文字等。按Unicode官网的路线图，计划分配的编码区段为：U+30000至U+31389：扩展区G、U+31400至U+33D1F：小篆（提案已提交）、U+33E00至U+355FF：甲骨文（提案已提交）。
## 4号平面至13号平面 U+40000 - U+DFFFF（尚未使用）
## 14号平面 U+E0000 - U+EFFFF 特别用途补充平面（SSP）目前仅摆放“语言编码标签”和“字形变换选取器”，它们都是控制字符。范围在U+E0000～U+E01FF。
## 15号平面 U+F0000 - U+FFFFF 保留作为私人使用区-A（PUA-A，Supplementary Private Use Area-A），65536个码位，未分配2个非字符
## 16号平面 U+100000 - U+10FFFF 保留作为私人使用区-B（PUA-B，Supplementary Private Use Area-B），65536个码位，未分配2个非字符
